            <button 
                className="true-square"
                squarevalue={squarevalue}
                onClick={() => console.log(squarevalue)}
            ></button>
            );
    } else {
        return (
        <button 
            className="false-square"
            squarevalue={squarevalue}
            onClick={() => setSquareValue(true)}
        ></button>
        );
    }
}
